$(document).ready(function(){var n=getUrlParameter("p");n&&($(".search-panel span#search_concept").text(n),$(".input-group #search_param").val(n));$(".search-panel .dropdown-menu").find("a").click(function(n){n.preventDefault();var t=$(this).attr("href").replace("#",""),i=$(this).text();$(".search-panel span#search_concept").text(i);$(".input-group #search_param").val(t);setFocusToSearchBar()});$("#searchSubmit").click(function(n){var t=$("#search_param");return t.val()==""?(n.preventDefault(),$("#searchFormAlert").fadeIn(),!1):($("#searchFormAlert").fadeOut(),!0)});$("#createPlanForm").on("keyup keypress",function(n){var t=n.keyCode||n.which;if(t===13)return n.preventDefault(),!1});$("#editPlanForm").on("keyup keypress",function(n){var t=n.keyCode||n.which;if(t===13)return n.preventDefault(),!1});$('[data-toggle="tooltip"]').tooltip()});setFocusToSearchBar=function(){document.getElementById("reggiesearchfield").focus()};getUrlParameter=function(n){for(var u=decodeURIComponent(window.location.search.substring(1)),r=u.split("&"),t,i=0;i<r.length;i++)if(t=r[i].split("="),t[0]===n)return t[1]===undefined?!0:t[1]};